import Botao from "../botao";

class Formulario extends React.Component {
    render() {
        return (
            <form action="">
                <div>
                    <label htmlFor=""></label>
                    <input type="text" />
                </div>
                <div>
                <label htmlFor="tempo">
                    Tempo
                </label>
                    <input 
                    type="time"
                    step="1"
                    name="tempo"
                    id="tempo"
                    min="00:00:00"
                    max="01:30:00"
                    required
                     />

                </div>

            <Botao/>
            </form>
        )
    }
}

export default Formulario;
